import projects from './Projects.json'

const Project = () => {
    return(
        <div>
            <h1>projects</h1>
            {
                projects.map(project => {
                    return(
                        <div>
                            <h1>{project.name}</h1>
                            <h2><a href={project.demo} target='#'>{project.name} demo ðŸ’»</a></h2>
                            <h2><a href={project.repository} target='#'>{project.name} repository</a></h2>
                        </div>
                    )
                })
            }
        </div>
    )
}

export default Project
